import './ConceptSequence.css';
import { useState } from 'react';


function ConceptSequence() {
  const [conceptSequence, changeConceptSequence] = useState(["tuneful singing", "beat", "loud v. soft", "high low chant", "fast slow", "high low melody", "rhythm long short", "qsd", "sm", "Z", "l", "2$", "d", "w", "r", "xxcc", "5P", "4$"]);
  return (
    <div>
      <h1>CONCEPT SEQUENCE</h1>
    </div>
  )
}

export default ConceptSequence;
